import React from 'react';
import { Link } from 'react-router-dom';

const UserAccount = () => {


    return (
        <div style={{ display: 'grid', gridTemplateColumns: 'repeat(2, 1fr)' }}>
            <Link to="/quotes"></Link>
            <Link to="/purchases">List of Previous Purchases</Link>
        </div>
    )
}

export default UserAccount;
